import logo from './logo.svg';
import './App.css';
import { Route, Switch } from 'react-router';
import Welcome_page from "./windows/welcom_page";

function App() {
  return (
      <Switch>
        <Route exact path='/' component={Welcome_page}/>
        <Route path='/login' component={Welcome_page}/>
      </Switch>
  );
}

export default App;
